import axios from "axios";

const ApiRequest = {
  Session: {
    Login: (params) => {
      return async (dispatch) => {
        try {
          const loginResponse = await axios
            .post('https://dev.perseo.tv/ws/Login.php', {
              params: {
                user: 'sdf',
                pass: 'dsf',
                device: 'web'
              },
            })
            .then(res => {
              this.setState({
                movies: res.data.items,
                status: "success",
                loader: false
              });
              //console.log(res);
            });
        } catch (err) {

        }
      };
    }
  }
}

export default ApiRequest;
